style.css:
@-moz-document domain("web.roblox.com"), domain("roblox.com"), domain("www.roblox.com") {
/*website theme*/
.container-main,
.content,
html
{background: #191919 !important;}
.dark-theme .rbx-left-col,
.dark-theme .rbx-header
{background: black;}
#games-carousel-page {margin-left: 75px}


/*footer*/
.dark-theme .container-footer {background: linear-gradient(0deg, #00000099 60%, #191919 100%);}
.footer .footer-link {
  transition: 0.2s;
  text-shadow: 0 0 12px white;
}
.footer .footer-link:hover {transform: scale(1.1)}
.footer .footer-link:active {transform: scale(0.9)}


/*roblox navbar logo*/
.icon-logo {transition: 0.2s;}
.icon-logo:hover {
  transform: scale(1.1);
  background-image: url(data:image/svg+xml;base64,) !important;
}
.icon-logo:active {
  transform: scale(1);
  background-image: url(data:image/svg+xml;base64,) !important;
}
.icon-logo-r {transition: 0.2s;}
.icon-logo-r:hover {
  transform: scale(1.1);
  background-image: url(data:image/png;base64,) !important;
}
.icon-logo-r:active {
  transform: scale(1);
  background-image: url(data:image/svg+xml;base64,) !important;
}


/*game&friend cards*/
.dark-theme .game-card-container .game-card-name,
.game-card .game-card-container .game-card-link .game-card-info,
.game-card .game-card-container .game-card-link .game-card-native-ad,
.game-carousel .game-card-container .game-card-link .game-card-info,
.game-carousel .game-card-container .game-card-link .game-card-native-ad,
.game-grid .game-card-container .game-card-link .game-card-info,
.game-grid .game-card-container .game-card-link .game-card-native-ad
{text-align: center;}
.dark-theme .game-card-container .game-card-name {margin-top: 10px;}
.friend, .member {
  border-radius: 10px;
  transition: 0.1s;
}
.friend:hover, .member:hover {background: black;}
.friend:active, .member:active {transform: scale(0.9);}
.game-carousel, .hlist, .section-content, .game-grid {overflow: visible !important;} /*E*/
.game-carousel:not(.friend):not(.member) .game-card-container:not(.friend),
.hlist .list-item:not(.friend):not(.member),
.game-grid:not(.friend):not(.member) .game-card-container:not(.friend)
{
  transition: 0.3s;
  user-select: none;
  border-radius: 10px;
  border: 1px solid #ffffff80;
  padding: 4px;
  background: #00000012;
  margin-bottom: 10px;
}
.hlist.game-cards > .list-item {
  padding-right: 0px !important;
  width: calc(160px) !important;
  margin-right: 10px !important;
}
.game-carousel .game-card-container:hover:not(.friend):not(.member),
.hlist .list-item:hover:not(.friend):not(.member),
.game-grid .game-card-container:hover:not(.friend):not(.member)
{
  transform: scale(1.07);
  background: #ffffff17;
  box-shadow: 0 0 12px 5px black;
}
.game-carousel .game-card-container:active:not(.friend):not(.member),
.hlist .list-item:active:not(.friend):not(.member),
.game-grid .game-card-container:active:not(.friend):not(.member)
{
  transform: scale(0.97);
  box-shadow: none;
  transition: 0.1s;
}
group-store-item.ng-scope.ng-isolate-scope {display: inline-block;}
group-store-item li.list-item.item-card {
  width: 135px;
  height: max-content;
  margin-right: 3px;
  transform: scale(0.96);
}
.hlist.avatar-cards li {
  transform: none !important;
  box-shadow: none !important;
  border: none !important;
  background: transparent !important;
  margin-bottom: 0 !important;
}
.hlist.avatar-cards li .avatar-card-container,
.hlist.avatar-cards li .avatar-card-container .avatar-card-content
{border-radius: 10px;}
.list-item.real-game-pass {
  box-shadow: none !important;
  transform: none !important;
  background: transparent !important;
}
.recommendations-container .recommended-items-slider {overflow: visible;}
/*rel2 - shop items border*/
.dark-theme.btr-gamedetails #store .store-cards .store-card {border: 0}


/*player badges*/
.profile-container .asset-item {
  width: min-content;
  text-align: center;
  margin-right: 7px;
}
.profile-container .asset-item .thumbnail-2d-container {
  width: 100%;
  text-align: center;
  background: transparent;
}
.profile-container .asset-item .item-name {
  width: 100%;
  text-align: center;
  max-width: 140px;
}
/*statistics*/
.slide-item-stats > .hlist .list-item {
  box-shadow: none !important;
  border: none !important;
  background: transparent !important;
  transform: none !important;
}


/*search page*/
#games-search-page .game-grid {margin-left: 60px}
.featured-grid-item-container {
  transform: none !important;
  box-shadow: none !important;
}
/*catlog*/
#catalog-content {margin-left: 55px}
.search-bars.search-bar-placement-right,
.dark-theme .catalog-container .sticky .search-bars,
.dark-theme .catalog-container .sticky .topic-container
{
  background: #19191980;
  backdrop-filter: blur(2em);
}
.dark-theme .catalog-container .sticky .topic-container {transform: translateX(-6px)}
.container-main .catalog-full-screen .catalog-results .item-cards-stackable .item-card,
.container-main .splash.catalog-full-screen .catalog-results .item-cards-stackable .item-card
{
  margin-right: 15px;
  margin-bottom: 15px;
  width: max-content;
}
.topic:hover {filter: brightness(1.5)}
.topic:active {filter: brightness(0.8)}



/*friends -- haha funny discord effect*/
.avatar-card-fullbody .avatar-card-image,
.avatar-card-fullbody .avatar-card-link,
.avatar .avatar-card-image,
.avatar .avatar-card-link
{transition: 0.2s;}
.avatar-card-fullbody .avatar-card-image:hover,
.avatar-card-fullbody .avatar-card-link:hover,
.avatar .avatar-card-image:hover,
.avatar .avatar-card-link:hover
{border-radius: 20px;}


/*left-side menu items*/
.left-col-list li {
  border-radius: 10px;
  padding: 5px;
  margin: 0px;
  border: 1px solid transparent;
  transition: 0.2s;
}
.left-col-list li:hover {
  background-color: #ffffff1a;
  border-color: white;
}
.left-col-list li:active {
  transform: scale(0.9);
  transition: 0.1s;
}
.rbx-upgrade-now {
  transform: none !important;
  background: transparent !important;
  border: none !important;
}
/*accidentally found this, but its cool so ill add it*/
.rbx-left-col li span[class^=icon] {transition: 0.1s}



/*top-bar*/
.dark-theme .rbx-header {
  background: radial-gradient(circle, #00000080 50%, #000000 60%);
  backdrop-filter: blur(2em)
}


/*side-bar*/
@media (min-width: 1688px) {
 
@media (min-width: 992px) {.rbx-left-col .rbx-scrollbar .left-col-list {width: calc(100% - 10px)}}

 .no-gutter-ads .rbx-left-col,.rbx-left-col {width: 230px}
  .no-gutter-ads .rbx-left-col .rbx-scrollbar,.rbx-left-col .rbx-scrollbar {width: 230px}
}
.rbx-left-col .rbx-scrollbar .left-col-list {width: 220px}


/*chats*/
.dialog-container {box-shadow: 0 0 20px 7px black}
.dark-theme .dialogs .dialog-container .dialog-message-container .dialog-message {background: black;}
.dark-theme .dialogs .dialog-container .dialog-message-container.message-inbound .dialog-message {
  background: #454545;
  border-color: #8c8c8c;
}
.dark-theme .dialogs .dialog-container .dialog-message-container .dialog-message.message-is-sending {
  background: transparent;
  border: 1px solid white;
}
.chat-main .chat-body {background: black}


/*dropdown*/
.dark-theme .popover.bottom>.arrow,
.dark-theme .popover.bottom>.arrow:after
{border-bottom-color: #00000080;}


/*text inputs*/
.dark-theme .rbx-header .navbar-search .input-field,
textarea,
input[type=text]
{transition: 0.2s;}
.dark-theme .rbx-header .navbar-search .input-field:focus,
textarea:focus,
input[type=text]:focus
{box-shadow: 0 0 12px white;}


/*badge list*/
.dark-theme .stack .stack-list .stack-row {
  background: black;
  border-radius: 10px;
}


/*sections*/
.section-content {border-radius: 10px;}


/*buttons - wack*/
button:active {filter: brightness(0.8)}
.dark-theme .btn-buy-md,
.dark-theme .btn-primary-lg,
.dark-theme .details-btns-fixed .btn-secondary-sm,
.dark-theme .btn-secondary-md,
.dark-theme .btn-control-md,
.dark-theme .btn-primary-md,
.dark-theme .btn-control-sm
{
  box-shadow: 0 3px #9d9d9d;
  transition: 0.05s;
}
.dark-theme .btn-buy-md:active,
.dark-theme .btn-primary-lg:active,
.dark-theme .details-btns-fixed .btn-secondary-sm:active,
.dark-theme .btn-secondary-md:active,
.dark-theme .btn-control-md:active,
.dark-theme .btn-primary-md:active,
.dark-theme .btn-control-sm:active
{
  box-shadow: 0 0px #9d9d9d;
  transform: translateY(3px);
}
/*what the hell*/ .dark-theme .btn-buy-md:active {transform: translate(3px, 3px)}
.dark-theme .btn-common-play-game-lg,
.dark-theme .btn-growth-lg {
  box-shadow: 0 3px #006841;
  transition: 0.05s;
}
.dark-theme .btn-common-play-game-lg:active,
.dark-theme .btn-growth-lg:active {
  box-shadow: 0 0px #006841;
  transform: translateY(3px);
}
.dark-theme .btn-common-play-game-lg:hover {
  background: linear-gradient(100deg, rgba(255,255,255,0) 0%, rgba(255,255,255,0.3) 50%, rgba(255,255,255,0) 100%);
  background-color: #00b06f;
  animation: placeholderShimmer 1s cubic-bezier(0.4, 0, 1, 1) 0s infinite normal forwards;
  background-repeat: no-repeat;
  background-size: 100% 100%;
}

/*avatar items*/
.profile-accoutrements-container .profile-accoutrements-slider .accoutrement-item a {transition: 0.2s;}
.profile-accoutrements-container .profile-accoutrements-slider .accoutrement-item a:hover {background: #909090;}
.profile-accoutrements-container .profile-accoutrements-slider .accoutrement-item a:active {
  transform: scale(0.9);
  transition: 0.1s;
}


/*scrollbars*/
.mCSB_scrollTools .mCSB_dragger
{
  border: 1px solid #868686;
  border-radius: 10px;
  width: 7px;
  transform: translateX(4px);
  transition: border-color 0.2s;
}
.mCSB_scrollTools .mCSB_dragger:hover
{border-color: white;}
::-webkit-scrollbar {width: 9px}
::-webkit-scrollbar-track {background: transparent}
::-webkit-scrollbar-thumb {
  background: transparent;
  border: 1px solid #464646;
  border-radius: 10px;
}
*:hover > ::-webkit-scrollbar-thumb {border-color: #868686}
::-webkit-scrollbar-thumb:hover {border-color: white}


/*loading cheez-it*/
.dark-theme .icon-default-logo-r,
.dark-theme .icon-logo-r,
.dark-theme .icon-logo-r-95
{
  animation: roll;
  animation-duration: 2s;
  animation-iteration-count: infinite;
}
.navbar-brand .icon-logo-r {animation: none}
@keyframes roll {
  50% {transform: rotate(360deg);}
  to {transform: rotate(360deg);}
}


/*social links*/
.medallion {transition: 0.2s}
.medallion:hover {
  box-shadow: 0px 0px 10px 0px white;
  background: #ffffff2e;
}
.medallion:active {
  transform: scale(0.96);
  box-shadow: none;
  background: #0000002e;
}


/*user creations*/
.slide-item-emblem-container img{transition: 0.2s}
.slide-item-emblem-container img:hover {
  transform: translateY(-5px);
  filter: brightness(1.2);
}
.slide-item-emblem-container img:active {
  transform: translateY(5px);
  filter: brightness(0.8);
}


/*less intrusive group announcements images*/
.announcement-display-image-aspect-ratio-wrapper {
  width: 600px;
  margin-left: auto;
  margin-right: auto;
}


/*game page*/
.col-xs-12.section-content.game-main-content.remove-panel.follow-button-enabled {
  background: #393b3d;
  padding-top: 11.2px;
  padding-left: 11.2px;
}
#game-details-carousel-container {border-radius: 10px}
.game-description-container,
#rbx-private-servers,
.stack.badge-container.game-badges-list
{
  background: #393b3d;
  border-radius: 10px;
  padding: 15px;
}
#rbx-private-servers > .create-server-banner.section-content.remove-panel {margin: 0}
.rbx-tab {border-radius: 10px}
.nav-tabs {background: #393b3d}
.dark-theme .rbx-tab .rbx-tab-heading:active {transform: scale(0.9)}
.dark-theme .rbx-tab .rbx-tab-heading {
  background: #393b3d;
  margin: 5px;
  border-radius: 10px;
  transition: 0.1s;
}
.rbx-tab a:hover {
  box-shadow: none !important;
  background-color: gray !important;
}
.rbx-tab.active {background: #393b3d}
.rbx-tab.active a {box-shadow: none !important}
.dark-theme .rbx-tabs-horizontal .nav-tabs {background: transparent}
.dark-theme .rbx-tabs-horizontal .rbx-tab .rbx-tab-heading.active {
  background: #393b3d;
  box-shadow: 0 0 0px 3px #393b3d;
}


/*acrylic*/
/*dropdowns*/
.rbx-header .rbx-navbar-right .popover-content,
.dark-theme .popover,
.dark-theme .dialogs .dialog-container .dialog-body,
.dark-theme .open .dropdown-menu
{background: transparent;}

/*chats*/
.dark-theme .dialogs .dialog-container .dialog-body,
.dialog-container .dialog-main,
.dialog-container.dialog-visible
{background: transparent;}

/*top bar glow*/
.dark-theme .rbx-header .rbx-navbar li {transition: 0.2s;}
.dark-theme .rbx-header .rbx-navbar li:hover {box-shadow: 0 6px 8px -6px white}
.dark-theme .rbx-header .rbx-navbar li:active {background: #828282 !important;}

/*actual tint*/
/*dropdowns*/
.dark-theme .dropdown-menu,
.people-info-card-container .place-container,
/*chats*/
.dark-theme .dialogs .dialog-container .dialog-body,
/*that one animated popup thingy*/
.dark-theme .modal-dialog .modal-content
{
  background: #00000080;
  backdrop-filter: blur(2em);
}


/*thumbnail carousel controls*/
.carousel-controls {
  box-shadow: none !important;
  transform: none !important;
  backdrop-filter: blur(5px);
  background: #00000080 !important;
}
.carousel-controls:hover {transform: scale(1.2) !important}
.carousel-controls:active {transform: scale(0.8) !important}


/*
                                                                    HACKS
*/
#results > ul.item-cards-stackable {
  padding-left: 45px;
  padding-right: 45px;
}
.store-card-caption button {transform: translateX(3px)}
ul.hlist.game-cards > .game-container > .list-item {
  border: 0px !important;
  box-shadow: none !important;
  transform: none !important;
  background: transparent !important;
  padding-right: 0px !important;
}
.hlist.game-cards.group-list {
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
}
group-games-item.game-card.game-tile.ng-isolate-scope {margin: 0px;}
ul.hlist.game-cards {
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
}
#games-carousel-page .hlist.games {flex-wrap: nowrap}
.game-grid.home-game-grid.wide-game-tile-game-grid .hover-game-tile.grid-tile.focused,
.game-grid.home-game-grid.wide-game-tile-game-grid .hover-game-tile.grid-tile.focused .featured-game-container
{
  background: transparent;
  max-height: 193px;
}
.game-grid.home-game-grid.wide-game-tile-game-grid .hover-game-tile.grid-tile {
  width: calc((var(--home-feed-width) / var(--items-per-row)) + 1px) !important;
  max-width: none !important;
  transform: scale(0.96);
}
.game-grid.home-game-grid.wide-game-tile-game-grid .hover-game-tile.grid-tile.focused {
  margin: 0;
  padding: 0;
}
.assets-explorer-main-content .item-cards li {
  height: 220px;
  float: none;
  transform: scale(0.96);
  margin-bottom: 0 !important;
}
.assets-explorer-main-content .item-cards {
  display: flex;
  flex-wrap: wrap;
}
.game-card-container thumbnail-2d, .game-card-thumb-container {
  display: flex;
  justify-content: center;
}
.items-list.avatar-item-list .item-card.six-column {
  margin-bottom: 0;
  transform: scale(0.95);
}


/*light theme message*/
body.light-theme:before {
  content: "the userstyle doesnt work with light theme";
  position: fixed;
  color: red;
  z-index: 99999999;
  left: 50%;
  top: 50%;
  transform: translate(-50%, -50%) scale(2);
  padding: 15px;
  background: #00000080;
  backdrop-filter: blur(2em);
  border-radius: 10px;
  pointer-events: none;
  animation: fadeout;
  animation-delay: 5s;
  animation-duration: 0.2s;
  animation-fill-mode: forwards;
}
@keyframes fadeout {to {opacity: 0;}}
}
